import React, { useContext, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { useHttpClient } from "../../hooks/http-hook";
import { AuthContext } from "../../context/auth-context";
import SelectCar from "./SelectCar";

const LastPayments = () => {
  const { sendRequest } = useHttpClient();
  const auth = useContext(AuthContext);

  const [loadedPayments, setLoadedPayments] = useState([]);

  useEffect(() => {
    const fetchPayments = async () => {
      try {
        const responseData = await sendRequest(
          `http://localhost:5500/api/payments/${auth.userId}/last`,
          'GET',
          null,
          {
            Authorization: "Bearer " + auth.token,
          }
        );
        setLoadedPayments(responseData.payments);
      } catch (err) {}
    };
    fetchPayments();
  }, [sendRequest, auth.token, auth.userId, loadedPayments]);

  return (
    <React.Fragment>
      {loadedPayments.map((payment) => (
        <Link key={payment._id}>{payment.name}</Link>
      ))}
      <SelectCar props={payment}/>
    </React.Fragment>
  );
};

export default LastPayments;
